mapper.select:

select 

from TB_SYS_SIGN_LOG
where APPLY_NO = #{APPLY_NO,jdbcType=VARCHAR}
  and PROCESS_TYPE = #{PROCESS_TYPE,jdbcType=VARCHAR}
  and SIGN_USER = #{SIGN_USER,jdbcType=VARCHAR}
  and TASK_START_TIME = #{TASK_START_TIME,jdbcType=TIMESTAMP}

mapper.delete:

delete from TB_SYS_SIGN_LOG
where APPLY_NO = #{APPLY_NO,jdbcType=VARCHAR}
  and PROCESS_TYPE = #{PROCESS_TYPE,jdbcType=VARCHAR}
  and SIGN_USER = #{SIGN_USER,jdbcType=VARCHAR}
  and TASK_START_TIME = #{TASK_START_TIME,jdbcType=TIMESTAMP}

mapper.update:

update TB_SYS_SIGN_LOG
set SIGN_DEPT = #{SIGN_DEPT,jdbcType=VARCHAR},
  APPROVED = #{APPROVED,jdbcType=CHAR},
  COMMENT = #{COMMENT,jdbcType=VARCHAR},
  PREV_USER = #{PREV_USER,jdbcType=VARCHAR},
  SIGN_TIME = #{SIGN_TIME,jdbcType=TIMESTAMP},
  PROC_TIME = #{PROC_TIME,jdbcType=BIGINT},
  PRINCIPAL_USER = #{PRINCIPAL_USER,jdbcType=VARCHAR},
  SIGN_USER_NAME = #{SIGN_USER_NAME,jdbcType=VARCHAR},
  SIGN_DEPT_NAME = #{SIGN_DEPT_NAME,jdbcType=VARCHAR},
  SIGN_POS = #{SIGN_POS,jdbcType=VARCHAR},
  SIGN_POS_NAME = #{SIGN_POS_NAME,jdbcType=VARCHAR}
where APPLY_NO = #{APPLY_NO,jdbcType=VARCHAR}
  and PROCESS_TYPE = #{PROCESS_TYPE,jdbcType=VARCHAR}
  and SIGN_USER = #{SIGN_USER,jdbcType=VARCHAR}
  and TASK_START_TIME = #{TASK_START_TIME,jdbcType=TIMESTAMP}
